ナイキ、半袖プラクティスシャツ。<br>
涼パフォーマンス向上に最適な高機能トレーニングアパレル、NIKE「エアロスイフト」コレクション。速乾性に優れたDRI-FIT素材を使用。袖口の横方向に配した2色のリブは、動きに合わせて色調が変化する。DRI-FIT素材が肌の表面から汗を逃がし、さらりと快適な状態をキープ。圧着加工のネックラインが不快感の無い滑らかなフィット感を提供。<br><br>
素材：DRI-FITジャガードニット<br>
品質：ポリエステル100％<br>
モデル：2017年春夏

<br><br>◆別売りアイテムとセットアップ可能<br>
